      "Perplexity": "The Star는 마르세유의 Rider-Waite-Smith를 가로지르는 17번째 메이저 아르카나 카드입니다.\n그리고 토트 전통은 천상의 희망, 치유의 갱신을 구현합니다.\n그리고 물병자리의 환상적인 빛은 어둠 뒤에 신성한 영감을 쏟아 붓습니다.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n\n사랑에 빠진 The Star는 취약성과 우주적 연결을 발산하고 상처를 치유하여 영혼의 유대를 강화하거나 파트너십에 대한 믿음을 회복합니다.\n싱글들은 진정성 있게 빛나며, 고요한 개방성을 통해 잔잔한 로맨스를 그려낸다.\n부부는 별의 지도 아래 정직한 양육을 통해 갱신됩니다.\n영적으로, 그것은 적나라한 진실이 초월적인 결합을 탄생시키는 보편적인 향유로서의 사랑을 확증합니다.\n\n💼 경력: 전문적 숙달의 정점\n\n성공을 위해 The Star는 창의적인 다운로드, 위기 이후의 우연한 기회 흐름, 예술, 치유 또는 인도주의적 추구의 축복 등 영감을 주는 혁신을 약속합니다.\n강제보다 직관적인 다운로드를 신뢰하십시오.\n균형은 지속 가능한 광채를 낳습니다.\n타로 전설은 7개의 별을 차크라 활성화로 환영하며, 평온한 확신으로 운명적인 번영을 비춥니다.\n\n🧠 사고방식: 내면의 지혜와 성장\n\nThe Star는 취약성 속에서도 우주적 다운로드를 받을 수 있다는 것에 감사하며 무릎을 꿇고 고요한 낙관주의를 키우고 있습니다.\n치유의 멈춤을 믿음의 그릇으로 받아들입니다.\n작은 행동이 보편적으로 파급됩니다.\n이 원형은 한 여성의 소망이 세상의 지친 희망을 새롭게 하는 영적 진정성을 일깨워줍니다.\n)",
      "Copilot": "별은 희망, 재생의 에너지를 구현합니다.\n그리고 신성한 인도는 영감과 치유의 카드이며, 혼란 뒤에는 명료함과 평화가 온다는 사실을 상기시켜 줍니다.\n그리고 더 밝은 지평을 약속합니다. 그 본질은 신앙과 다시 연결되고 삶의 흐름을 신뢰하는 것입니다.\n그리고 낙관주의가 앞으로 나아갈 길을 밝히도록 허용합니다. 💖 In Love는 취약성과 개방성을 장려합니다. 싱글이라면 과거의 상처를 풀고 신뢰와 진정성을 바탕으로 새로운 관계를 맺는 것을 의미합니다.\n관계에서는 용서를 실천하고, 꿈을 공유하여 친밀감을 다시 불러일으키고, 조화를 회복하는 정서적 정직을 위한 공간을 만드는 등 치유와 갱신이 필요합니다. 💼 Career에서 The Star는 비전과 영감을 지도력으로 강조합니다. 이는 자신의 더 높은 목적에 부합하는 일을 추구하고, 다른 사람을 고양시키는 창의적인 프로젝트를 수용하거나, 같은 생각을 가진 사람들과 네트워크를 형성하고, 기술을 연마하고, 열정을 바탕으로 전문적인 선택을 함으로써 장기적인 목표에 계속 집중할 때 기회가 나타날 것이라고 믿는 것을 의미할 수 있습니다. 💰 Wealth에서 The Star는 점진적인 발전에 대한 인내와 믿음을 조언합니다. 좌절로부터의 회복이나 구조 조정 습관과 같은 재정적 치유가 필요할 수 있지만, 이 카드는 일관된 노력과 낙관주의를 통해 안정성과 풍요로움이 돌아올 것을 보장합니다. 실용적인 단계에는 현실적인 저축 목표 설정, 귀하의 가치에 부합하는 영역에 투자하는 것이 포함됩니다.\n그리고 이미 가지고 있는 것에 대해 감사하는 마음을 키우십시오. ✨ 궁극적으로 The Star는 희망과 진정성을 포용함으로써 이를 확인하는 격려의 등대입니다.\n그리고 갱신을 통해 조화와 성취의 삶을 창조할 수 있습니다. ❤️ 당신의 비전을 신뢰하고, 당신의 정신을 키우세요.\n그리고 앞의 빛이 당신을 사랑과 직업의 지속적인 성공으로 인도할 것임을 아십시오.\n그리고 재정적 안녕.",
      "Llama": "별은 희망, 영감의 원형을 표현합니다.\n그리고 내부 안내는 프랑스 신비주의자들이 만들고 나중에 Arthur Edward Waite의 Rider-Waite-Smith(RWS) 덱으로 대중화된 15세기 우화 카드로 거슬러 올라가는 기원을 가진 다양한 타로 덱에서 발견됩니다. 이 카드는 치유, 재생의 에너지를 구현합니다.\n그리고 긍정적인 잠재력.\n\n 별은 직관, 내면의 지혜를 인도하는 빛을 상징하는 천체를 나타냅니다.\n그리고 더 높은 의식. 이는 내면의 안내 시스템과 우주와의 연결에 대한 신뢰를 의미하며, 이는 삶의 자연스러운 전개에 대한 믿음이 커짐을 의미합니다.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n 이 카드는 낭만적인 관계를 탐색하거나 사랑에 영향을 미치는 결정을 내릴 때 감정적 직관과 내면의 지혜를 믿으라고 조언합니다. 마음의 속삭임을 듣고 장기적인 성취를 위해 내면의 나침반을 따르십시오.\n\n💼 경력: 전문적 숙달의 정점\n The Star는 자신의 진정한 소명에 자신을 맞추고, 자신의 가치에 부합하고 내면의 영감을 불러일으키는 활동과 일을 추구할 것을 제안합니다. 내면의 인도에 귀를 기울이고 그 방향을 따르면서 목적의식을 키우십시오.\n\n💰 부: 완전한 재정적 자유와 지속적인 유산\n 이 카드는 우주의 풍요로움을 신뢰하고 재정 문제에 대한 낙관적인 전망을 키우는 것을 나타냅니다.\n그리고 다른 사람들에게 자원을 돌려주고 공유하는 데 초점을 맞춘 사고방식을 유지하세요. 당신의 번영은 기쁨과 가치를 전파하는 것과 연결되어 있음을 인식하십시오."
