      "DeepSeek": "달은 무의식, 환상과의 대결을 구현한다.\n그리고 잠재된 두려움은 The Star의 명확성에서 필요하지만 위험한 하강입니다.\n심각한 위험은 심리적 붕괴입니다.\n💖 사랑: 투사, 편집증이 지배하는 관계.\n그리고 파트너가 서로의 심령 드라마에서 유령이 되는 무언의 신경증도 있습니다.\n💼 경력: 인식이 왜곡되고 충성도가 유동적이어서 치명적인 실수를 저지를 위험이 있는 고의적인 잘못된 정보나 숨겨진 의제가 있는 환경을 탐색합니다.\n💰 부: 가려진 위험, 시장기만 또는 자신의 비합리적인 편견에 노출되어 신기루에 대한 투자로 이어집니다.\n🎁 [잠재적 보상]\n 보이지 않는 것에 대한 직관적인 통달:\n💖 사랑: 서로의 그림자를 탐색하고 통합하여 깊은 친밀감을 얻습니다.\n💼 직업: 기본 흐름에 대한 초자연적인 본능을 개발하고 모호한 상황에서 이점을 얻습니다.\n💰 부: 시장이 인식되기 전에 저평가되거나 잘못 이해된 자산을 인식하고 이를 활용합니다.\n그 길은 망상에 굴복하지 않고 횡단하는 망상을 요구합니다.",
      "Perplexity": "달(The Moon)은 마르세유의 라이더-웨이트-스미스(Rider-Waite-Smith)에 있는 18번째 메이저 아르카나 카드입니다.\n그리고 토트 전통은 달의 신비와 잠재의식의 환상을 구현합니다.\n그리고 직관과 속임수 사이에 있는 물고기자리의 어두운 길.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n\n사랑에 빠진 달은 숨겨진 감정과 정신적 저류를 불러일으킵니다. 불확실성은 판단을 흐리게 하고 관계에 대한 예측이나 무언의 두려움을 드러냅니다.\n싱글들은 혼란 속에서 기만적인 매력을 탐색하거나 영혼의 연결을 향한 직관적인 끌어당김을 탐색합니다.\n부부는 표면적 현실보다 꿈을 믿으며 잠긴 문제에 직면합니다.\n영적으로, 그것은 진정한 계시를 위해 은빛 빛이 신기루를 녹이는 사랑의 조수 깊이를 드러냅니다.\n\n💼 경력: 전문적 숙달의 정점\n\n성공을 위해 The Moon은 안개가 자욱한 길에 대해 경고합니다. 오해의 소지가 있는 기회, 직관적인 직감 또는 창의적인 안개는 예술적 또는 심령 분야에 헌신하기 전에 분별력을 요구합니다.\n숨겨진 장애물이 표면에 나타납니다.\n잘못된 조명보다는 내부 나침반을 사용하여 탐색합니다.\n타로 전설은 가재를 원초적 본능이 상승하고 밤의 불확실성으로부터 명확성을 낳는 것으로 캐스팅합니다.\n\n🧠 사고방식: 내면의 지혜와 성장\n\n달은 불확실성을 통해 직관적인 탐색을 기르고 그림자와 꿈을 존중합니다.\n그리고 이성적인 시각을 넘어서는 영혼의 인도로서 직감이 속삭인다.\n교사로서 모호함을 받아들이십시오.\n불안은 보이지 않는 진실이 나타나고 있다는 신호입니다.\n이 원형은 달의 주기가 두려움을 정신적 주권으로 바꾸는 영적 경계성을 불러일으킵니다.\n)",
      "Copilot": "달은 환상과 직관의 에너지를 구현합니다.\n그리고 잠재의식의 숨겨진 영역, 그것은 불확실성, 꿈의 카드입니다.\n그리고 분별력을 가지고 그림자를 탐색해야 합니다. 그 본질은 모든 것이 보이는 것과 같지 않다는 점을 상기시켜 주며, 외부 상황이 불분명하거나 기만적이라고 느낄 때 내면의 나침반을 신뢰하도록 촉구합니다. 💖 사랑에 있어서 The Moon은 주의와 감정적 인식을 조언합니다. 싱글인 경우 환상이나 허위 표현으로 흐려질 수 있는 관계를 염두에 두고 표면적인 매력을 넘어 자신의 본능을 신뢰하도록 격려합니다.\n파트너십에서는 오해를 해결하고, 무언의 두려움을 명확히 하는 것이 필요합니다.\n그리고 불안감에 대해 솔직한 대화를 나누거나 투사가 현실을 왜곡하는 시기를 인식하는 등 투명성을 강화합니다. 💼 Career에서 The Moon은 전문적인 문제에 있어서 분별력과 인내의 중요성을 강조합니다. 이는 불분명한 지침, 숨겨진 의제 또는 불확실한 기회를 탐색하고 명확해질 때까지 성급하게 결정을 내리지 않도록 상기시키는 것을 의미할 수 있습니다. 실제 단계에는 계약을 다시 확인하고 신뢰할 수 있는 멘토에게 조언을 구하는 것이 포함됩니다.\n그리고 뭔가 기분이 좋지 않을 때 직관에 귀를 기울이십시오. 💰 Wealth에서 The Moon은 사실이라고 믿기에는 너무 좋아 보이는 재정적 환상이나 위험한 모험에 대해 경고합니다. 충동적인 지출을 피하고 투자에 대해 철저히 조사하도록 권장합니다.\n그리고 작은 글씨를 검토하거나 재정 습관의 패턴을 추적하는 등 숨겨진 비용이나 불안정성을 드러낼 수 있는 미묘한 징후에 주의를 기울이십시오. ✨ 궁극적으로 달은 불확실성을 헤쳐나가는 안내등이며, 직관을 믿고 명확성을 추구함으로써 이를 확인합니다.\n그리고 인내심을 갖고 행동하면 혼란을 지혜로 바꿀 수 있습니다. 의심스러운 순간에도 당신의 내면의 인도는 사랑과 직업의 안정과 성취를 향한 길을 밝혀줄 것입니다.\n그리고 금융생활.",
      "Llama": "달은 환상, 직관의 원형을 표현한 것입니다.\n그리고 내부 지식은 프랑스 신비주의자들이 만든 15세기 우화 카드로 거슬러 올라가고 나중에 Arthur Edward Waite의 Rider-Waite-Smith(RWS) 덱으로 대중화되었던 다양한 타로 덱에서 발견됩니다. 이 카드는 불확실성, 혼란의 에너지를 구현합니다.\n그리고 감도가 높아졌습니다.\n\n 달은 합리적 사고가 제한된 잠재의식의 유동적이고 꿈같은 상태를 나타냅니다.\n그리고 감정, 본능.\n그리고 직관이 더욱 지배적이 됩니다. 이는 모호함과 환상을 탐색해야 함을 의미합니다.\n그리고 명확성과 분별력을 갖춘 불확실성.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n 이 카드는 복잡한 감정적 상황이나 관계를 헤쳐나갈 때 직관을 믿으라고 조언합니다. 사랑은 신비 속에 가려질 수 있다는 것을 인식하세요. 이성적인 추론보다는 직감을 따르세요.\n\n💼 경력: 전문적 숙달의 정점\n The Moon은 직업 세계에 대한 오해의 소지가 있는 정보, 소문 또는 오해에 주의할 것을 제안합니다. 자신의 직감을 신뢰하고 비판적 분별력을 사용하여 미묘한 인상과 내면의 지식을 바탕으로 정보에 입각한 결정을 내립니다.\n\n💰 부: 완전한 재정적 자유와 지속적인 유산\n 이 카드는 지식 부족이나 잘못된 의사 결정으로 인한 잠재적인 재정적 위험과 숨겨진 위험을 염두에 두고 있음을 나타냅니다. 재정을 다룰 때 직관적인 인식을 연습하고 미묘한 시장 동향에 계속 주목하세요."
