      "Perplexity": "The Sun은 마르세유의 Rider-Waite-Smith를 가로지르는 19번째 메이저 아르카나 카드입니다.\n그리고 토트 전통은 빛나는 활력과 흐려지지 않는 기쁨을 구현합니다.\n그리고 인생의 가장 높은 진리를 밝히는 태양의 깨달음입니다.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n\n사랑으로, The Sun은 열린 마음의 결합이나 의심을 없애는 즐거운 계시를 축하하며 관계를 순수한 행복과 명확함으로 목욕시킵니다.\n싱글은 자석 같은 따뜻함을 발산하여 장난스러운 영혼의 연결을 쉽게 끌어들입니다.\n커플은 어린아이 같은 친밀감과 창의적인 열정을 즐깁니다.\n그리고 상호 축하.\n영적으로 사랑은 취약성이 영원하고 생명을 긍정하는 조화로 피어나는 신성한 빛임을 확증합니다.\n\n💼 경력: 전문적 숙달의 정점\n\n성공을 위해 The Sun은 승리의 업적과 풍부한 번영을 예고합니다.\n그리고 리더십, 예술, 벤처 등의 노력이 스포트라이트를 받으며 번성하고 있다는 사실도 인정을 받습니다.\n활력은 멈출 수 없는 발전을 촉진합니다.\n긍정은 기회를 황금 시대로 만들어줍니다.\n타로 지식은 해바라기를 의식적 숙달로 장식하며 내면의 빛이 세상적인 찬사와 유산을 나타냅니다.\n\n🧠 사고방식: 내면의 지혜와 성장\n\n태양은 순진한 자신감과 가려지지 않는 진정성으로 삶의 놀이터를 포용하면서 넘치는 긍정성을 배양합니다.\n두려움을 어린아이 같은 경이로움으로 풀어보세요.\n성공은 노력보다 일치된 기쁨에서 나옵니다.\n이 원형은 깨달은 존재가 존재를 영원한 축하로 변화시키는 영적 태양신경총의 힘을 일깨웁니다.\n)",
      "Copilot": "태양은 기쁨과 명료함의 빛나는 에너지를 구현합니다.\n그리고 활력은 깨달음, 성공의 카드입니다.\n그리고 성장과 성취를 가져오는 순수한 생명력입니다. 그 본질은 낙관주의와 자신감을 말합니다.\n그리고 진실의 힘이 드러나면서, 빛이 우리의 길을 비출 때 장애물은 사라지고 가능성은 넓어진다는 사실을 상기시켜 줍니다. 💖 In Love, The Sun은 개방성과 장난기를 장려합니다.\n그리고 진정한 연결; 싱글인 경우, 자신의 진정한 정신에 공감하는 파트너를 끌어들이기 위해 자신감과 긍정적인 태도를 받아들이는 것이 좋습니다.\n관계에서는 함께 즐거운 경험을 계획하고, 공개적으로 감사를 표하고, 웃음과 따뜻함을 통해 로맨스를 다시 불러일으키는 등 공유된 행복을 축하하는 것의 중요성을 강조합니다. 💼 경력에서 태양은 성취, 인정을 나타냅니다.\n그리고 방향의 명확성; 이는 자신의 노고에 대한 인정을 받는 것, 자신감을 갖고 리더십을 발휘하는 것, 열정에 부합하는 프로젝트를 추구하는 것을 의미할 수 있습니다. 실용적인 단계에는 자신의 재능을 대담하게 보여주고, 다른 사람을 고양시키는 협업을 수용하는 것이 포함됩니다.\n그리고 당신의 노력이 가시적인 성공으로 보상받을 것이라고 믿습니다. 💰 Wealth에서 The Sun은 책임감과 함께 낙관주의를 조언합니다. 재정적 기회는 번성할 가능성이 높지만 장기적 안정성을 가져오는 벤처에 투자하고 과도하지 않은 이정표를 축하하는 등 번영을 현명하게 관리하는 것이 중요합니다.\n그리고 풍요로움을 이용해 자신과 타인을 위한 안전과 기쁨을 창조하세요. ✨ 궁극적으로 The Sun은 긍정성과 진정성을 포용함으로써 이를 확인하는 격려의 등대입니다.\n그리고 명확성을 통해 사랑과 직업을 넘나들며 성취감 있는 삶을 창조할 수 있습니다.\n그리고 재정. 🙂 성공과 행복은 가능할 뿐만 아니라 자신감과 기쁨을 가지고 앞으로 나아갈 때 손에 닿을 수 있다는 것을 알고 자신의 활력의 빛을 믿으세요.",
      "Llama": "태양은 기쁨, 조명의 원형을 표현합니다.\n그리고 빛은 프랑스 신비주의자들이 만든 15세기 우화 카드로 거슬러 올라가고 나중에 Arthur Edward Waite의 Rider-Waite-Smith(RWS) 덱으로 대중화되었던 다양한 타로 덱에서 발견됩니다. 이 카드는 희망, 성취의 에너지를 구현합니다.\n그리고 긍정.\n\n 태양은 모든 극성이 조화롭게 균형을 이루는 인간 의식의 가장 높은 측면을 나타내며 깨달음과 내면의 따뜻함을 상징합니다. 그것은 완전한 이해와 수용의 상태에서 살아가는 것을 의미합니다.\n그리고 자신과 세상과의 단결.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n 이 카드는 자신의 진정한 자아를 포용하고 관계의 진정성을 표현하도록 조언합니다.\n그리고 삶의 모든 측면에서 사랑의 존재를 축하합니다. 빛을 발산하여 내면의 빛을 공유하고 진정한 연결을 위한 매력적인 자석이 되어보세요.\n\n💼 경력: 전문적 숙달의 정점\n 태양은 당신에게 기쁨과 성취감을 가져다 주는 활동을 병행할 것을 제안합니다.\n그리고 목적의식. 귀하의 열정과 열정을 활용하여 앞으로 나아갈 길을 밝히고 직업 생활에서 진정한 성공을 이룰 수 있습니다.\n\n💰 부: 완전한 재정적 자유와 지속적인 유산\n 이 카드는 외부 검증이나 물질적 소유보다는 진정한 표현을 통해 진정한 부의 창출에 중점을 두고 내면의 빛과 광채를 진정한 번영의 원천으로 키우는 것을 나타냅니다."
