      "Perplexity": "Four of Wands, 마르세유 Rider-Waite-Smith의 네 번째 Fire pip입니다.\n토트 마이너 아르카나(Thoth Minor Arcana) 전통은 축하의 안정성과 공동의 조화를 구현합니다.\n그리고 신성한 기초를 성공적으로 확립한 국내 승리입니다.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n\n사랑에 빠진 Four of Wands는 결혼식, 기념일, 공동체의 환영과 정서적 안정으로 축복받은 동창회 등 즐거운 이정표를 예고합니다.\n싱글들은 헌신적인 행복으로 피어나는 안정적인 매력을 축하합니다.\n커플은 지속적인 파트너십의 화환을 짜며 공동의 안식처를 즐깁니다.\n영적으로, 그것은 사랑의 난로불이 마음이 영원한 거처를 짓는 신성한 건축물임을 확증합니다.\n\n💼 경력: 전문적 숙달의 정점\n\n성공을 위해 Four of Wands는 사업 확장이 안정되고, 프로젝트가 성공적으로 완료되거나, 팀이 기업 축하 행사에서 단결하는 등 번영하는 귀향을 의미합니다.\n기초는 유산으로 굳어집니다.\n공동의례를 통해 풍요를 환영합니다.\n타로 전설은 기업이 공동 번영으로 꽃피우는 물질적 숙달로 꽃 캐노피를 장식합니다.\n\n🧠 사고방식: 내면의 지혜와 성장\n\nFour of Wands는 감사의 축하 행사를 조성하고, 난로와 유산을 영적 닻으로 기리면서 공동의 기쁨으로 완성된 주기를 기립니다.\n정체되지 않고 소속감을 받아들입니다.\n안정성은 새로운 모험을 탄생시킵니다.\n이 원형은 삶의 신성한 울타리 안에서 춤추는 주권자, 내면의 고귀함을 일깨웁니다.",
