      "DeepSeek": "Three of Cups는 공유된 기쁨과 협력을 나타내는 축하 공동체로의 두 쌍의 심리적 확장을 구현합니다.\n그리고 집단적 결실.\n핵심 위험은 산만함입니다.\n💖 사랑: 기본 유대를 심화하고 친밀감을 수행적 유쾌함으로 희석시키는 필수적이고 때로는 고립적인 작업보다 사회적 검증과 그룹 조화를 우선시합니다.\n💼 경력: 개인의 책임과 경쟁 우위를 희생하면서 네트워킹 및 협력 문화에 대한 과도한 투자로 인해 신용이 확산되고 결과가 희석됩니다.\n💰 부: 위험은 사회적 압력이 신중한 분석을 무시하고 자본과 관계 모두를 위험에 빠뜨리는 지나치게 공동체적이거나 감정 중심의 투자(예: 친구와 자금을 모으는 것)에 있습니다.\n🎁 [잠재적 보상]\n 비옥한 시너지 효과:\n💖 사랑: 지원하는 커뮤니티 내에서 파트너십을 안전하게 통합하여 외부 에너지와 공유 축하를 통해 이를 풍성하게 합니다.\n💼 경력: 효과적인 팀워크에서 탄생한 실질적인 성공과 혁신으로, 인정을 받고 결과가 증폭됩니다.\n💰 부: 리드를 제공하고 위험을 공유하는 강력하고 신뢰할 수 있는 네트워크의 이점.\n그리고 협업 기회, 자원 증대.\n그것은 영양과 기분 전환 사이의 분별력을 요구하는 사회적 수확입니다.",
      "Perplexity": "Three of Cups는 마르세유 Rider-Waite-Smith의 세 번째 워터 핍입니다.\n토트 마이너 아르카나(Thoth Minor Arcana) 전통은 즐거운 축하와 자매 결속을 구현합니다.\n그리고 신성한 잔치를 벌이는 여사제들이 춤추는 것으로 상징되는 공동체적 엑스터시.\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n\n사랑에 빠진 Three of Cups는 삼각 조화로 반짝입니다. 부자, 가장 친한 친구 소울메이트, 지역 사회 지원의 축복을 받은 커플이 공유된 의식과 웃음을 통해 정서적 풍요를 만들어냅니다.\n싱글들은 사교 모임이나 힐링 모임을 통해 로맨스를 찾습니다.\n결혼식과 같은 집단적 축복을 통해 기존 유대가 ​​더욱 깊어집니다.\n영적으로, 이는 신성한 친교를 통해 마음이 기쁨을 배가시키는 사랑의 신성한 순환을 확증합니다.\n\n💼 경력: 전문적 숙달의 정점\n\n성공을 위해 Three of Cups는 협력적 승리를 예고합니다. 즉, 팀 승리, 네트워킹 이벤트 또는 창의적인 집단이 예술, 치유 또는 서비스 분야의 상호 지원을 통해 번영을 가져옵니다.\n축하 커미션은 공동의 창의성에서 나옵니다.\n고독은 시너지적인 부를 가져온다.\n타로 지식은 공유된 성배가 기회로 넘쳐나는 관계적 부로서 꽃의 풍성함을 관장합니다.\n\n🧠 사고방식: 내면의 지혜와 성장\n\nThree of Cups는 집단적 활력 속에서 개인의 성배 주권을 존중하는 동시에 신뢰할 수 있는 집단 내의 취약성을 포용하고 풍부한 소속감을 배양합니다.\n의식적 연결을 통해 고립을 풀어주세요.\n기쁨은 기하급수적으로 증가합니다.\n이 원형은 영적 자매애를 일깨우고 개인적인 치유를 축하의 공동체적 비약으로 변화시킵니다.",
      "Copilot": "Three of Cups는 축하와 우정의 에너지를 구현합니다.\n그리고 즐거운 연결은 공동체의 카드이자 성공을 공유하는 카드입니다.\n그리고 정서적 고양을 통해 성취감은 종종 우리가 다른 사람들과 키우는 단결과 유대를 통해 이루어진다는 것을 상기시켜줍니다. 그 본질은 조화와 감사를 말합니다.\n그리고 집단적 기쁨의 힘은 우리가 이정표를 기리고 주변 사람들의 지원을 받아들이도록 격려합니다. 💖 사랑에서 세 개의 컵은 우정과 공유된 행복의 중요성을 강조합니다. 싱글이라면 사교 모임, 우정, 지역 사회 행사를 통해 잠재적인 파트너를 만나는 것이 좋습니다.\n관계에서는 기념일을 통해, 성취를 공유하거나, 단순히 친밀감을 강화하는 기쁨의 순간을 만드는 등 함께 축하하는 것을 강조합니다. 💼 경력에서 이 카드는 협력, 팀워크를 나타냅니다.\n그리고 그룹 환경 내에서의 인식; 이는 프로젝트 완료를 축하하거나, 동료로부터 인정을 받거나, 협력적인 노력을 통해 영감을 얻는 것을 의미할 수 있습니다. 실용적인 단계에는 긍정적인 직장 관계 조성, 팀 축하 조직 등이 포함됩니다.\n그리고 사기와 화합을 구축하기 위해 다른 사람들의 기여를 인정합니다. 💰 Wealth에서 Three of Cups는 사랑하는 사람들과 번영을 나누고 기쁨을 주는 경험에 투자하여 재정적 안정을 누릴 것을 조언합니다. 여기에는 축적에만 집중하기보다는 모임을 주최하고, 지역 사회 활동을 지원하거나, 의미 있는 추억을 만들기 위해 자원을 사용하는 것이 포함될 수 있습니다. ✨ 궁극적으로 Three of Cups는 기쁨과 연결을 포용함으로써 이를 확인하는 감사와 집단적 성취의 카드입니다.\n그리고 축하하면 사랑과 직업을 풍요롭게 할 수 있습니다.\n그리고 금융생활. 🙂 커뮤니티의 힘을 신뢰하고 행복을 공유하세요. 이러한 유대감이 여러분의 여정에서 계속해서 여러분을 고양하고 지탱할 것임을 알고 있습니다.",
      "Llama": "Three of Cups는 감정, 기쁨의 원형을 표현한 것입니다.\n그리고 축하 카드는 프랑스 신비주의자들이 만든 15세기 우화 카드로 거슬러 올라가고 나중에 Arthur Edward Waite의 Rider-Waite-Smith(RWS) 덱으로 대중화되었던 다양한 타로 덱에서 발견됩니다. 이 카드는 기쁨과 우정의 에너지를 구현합니다.\n그리고 공동 연결.\n\n Three of Cups는 세 명의 여성이 원을 그리며 함께 축하하는 모습을 묘사하며, 종종 여성의 단결, 자매애와 관련이 있습니다.\n그리고 즐거운 모임.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n 이 카드는 사랑하는 사람들과의 좋은 시간을 우선시하고, 공유 활동을 통해 의미 있는 관계를 구축함으로써 정서적 연결을 육성할 것을 조언합니다.\n그리고 전반적인 웰빙을 위한 사회적 연결의 중요성을 인정합니다.\n\n💼 경력: 전문적 숙달의 정점\n Three of Cups는 직장에서 우정을 쌓고 동료의 성공을 축하함으로써 지원적인 업무 환경을 조성할 것을 제안합니다.\n그리고 직업 만족도와 동기를 높이기 위해 소속감을 형성합니다.\n\n💰 부: 완전한 재정적 자유와 지속적인 유산\n 이 카드는 공동 번영을 촉진하는 자원 공유, 그룹 투자 또는 협력 벤처를 통해 지역 사회의 부와 재정적 지원의 가치를 인식하고 있음을 나타냅니다."
