      "DeepSeek": "Page of Cups는 감정적 자아의 초기 수용적 측면을 구현하며, 직관적인 메시지와 부드러운 창의적 시작의 예고입니다.\n가장 큰 위험은 순진한 감상주의입니다.\n💖 사랑: 사소한 몸짓에 심오한 의미를 투영하는 호감 기반 이상주의로 나타나며, 사용할 수 없거나 피상적인 파트너와 감정적으로 얽히게 됩니다.\n💼 직업: 기술보다는 낭만적인 자기 이미지를 바탕으로 창의적이거나 도움이 되는 직업을 추구하는 것이 위험하며, 이로 인해 시장 현실과 비판에 대한 준비가 부족해집니다.\n💰 부: 이는 실사 없이 개념(예: 친구의 벤처)에 대한 미성숙하고 \"마음이 주도하는\" 투자를 나타내며, 자본을 도구가 아닌 감정적인 제공으로 취급합니다.\n🎁 [잠재적 보상]\n 진정한 감정의 발아:\n💖 사랑: 성장과 순진한 발견을 육성하기 위한 진정한 잠재력과의 진실하고 개방적인 연결의 시작입니다.\n💼 경력: 진정한 창의적 소명 또는 자신의 작업에 대한 참신하고 공감적인 접근 방식을 처음으로 직관적으로 암시하는 것입니다.\n💰 부: 합리적으로 육성할 경우 감정적, 재정적 배당금을 얻을 수 있는 개인적으로 의미 있는 자산 또는 벤처에 대한 초기, 종종 소규모 투자입니다.\n그것은 성급한 냉소주의나 과다 노출로 인해 쉽게 짓밟히는 취약한 감정의 싹입니다.",
      "Perplexity": "페이지 오브 컵스(Page of Cups), 마르세유 라이더-웨이트-스미스의 물같은 청년.\n그리고 토트 마이너 아르카나(Thoth Minor Arcana) 전통은 직관적인 감성과 감정을 전달하는 메신저를 구현합니다.\n그리고 물고기자리에서 영감을 받은 꿈과 창조적 영감의 성배를 담고 있는 순수한 마음의 상상력.\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n\n사랑에 빠진 Page of Cups는 순진한 경이로움과 감정적 개방성으로 끓어오르는 부드러운 제안, 심령적 직관 또는 장난스러운 짝사랑을 전달합니다.\n싱글은 꿈이나 온화한 숭배자를 통해 감동적인 초대를 받습니다.\n커플은 예술적인 몸짓과 취약한 표현을 통해 로맨스를 재발견합니다.\n영적으로, 그것은 젊은 감정이 심장 차크라의 순수함을 일깨우는 사랑의 시적 신탁을 예고합니다.\n💼 경력: 전문적 숙달의 정점\n\n성공을 위해 Page of Cups는 창의적인 다운로드, 즉 직관적인 비즈니스 아이디어, 예술적 커미션 또는 자비로운 기업을 향해 부드럽게 다가가는 치유의 직업을 알립니다.\n정신적, 치료적, 상상적 분야에서 감성 지능을 포용하세요.\n민감성은 비전통적인 번영을 자화시킵니다.\n타로 전설은 물고기 메신저를 번영하는 직관으로 묘사하며, 마음의 지혜가 혁신적인 풍요를 인도합니다.\n🧠 사고방식: 내면의 지혜와 성장\n\n페이지 오브 컵(Page of Cups)은 직관적인 속삭임과 예술적인 분위기를 신성한 지침으로 존중하는 동시에 부드러운 행동을 통해 환상을 기반으로 몽환적인 수용력을 키워줍니다.\n부담 없이 취약점을 환영합니다.\n감정은 창조적인 천재의 탄생입니다.\n이 원형은 영적인 민감성을 일깨우고 감정의 흐름을 직관적인 주권으로 변화시킵니다.",
      "Copilot": "Page of Cups는 정서적 개방성과 창의성의 에너지를 구현합니다.\n그리고 새로운 시작의 부드러운 감동, 그것은 순수함, 직관의 카드입니다.\n그리고 진심 어린 탐험은 취약성과 상상력이 성장을 향한 강력한 관문임을 상기시켜줍니다. 그 본질은 호기심과 수용성을 나타냅니다.\n그리고 정서적 진실성을 받아들이는 용기는 우리가 마음의 조용한 속삭임을 듣도록 격려합니다. 💖 사랑에서 컵의 페이지는 다정한 기회와 애정의 꽃피움을 제안합니다. 싱글이라면 로맨스를 촉발할 수 있는 예상치 못한 만남이나 초대를 가리키며, 미묘하고 놀라운 방식으로 찾아오는 가능성에 열려 있도록 촉구합니다.\n관계에서는 작은 몸짓과 진심 어린 의사소통을 통해 친밀감을 키우는 것이 중요하다는 점을 강조합니다.\n그리고 친절한 행동 - 실제적인 단계에는 감정을 솔직하게 표현하기, 사랑의 편지 쓰기, 정서적 연결을 심화시키는 공유 경험 만들기 등이 포함됩니다. 💼 경력에서 이 카드는 창의적인 영감과 새로운 사업의 잠재력을 나타냅니다. 이는 예술적 프로젝트를 탐색하거나, 혁신적인 아이디어를 수용하거나, 직관을 통해 전문적인 선택을 하는 것을 의미할 수 있습니다. 실행 가능한 조언에는 상상력을 키우고, 새로운 기술을 개발하기 위한 멘토링을 찾는 것이 포함됩니다.\n그리고 관습에 얽매이지 않는 것처럼 보이지만 감정적인 반향을 불러일으킬 수 있는 기회에 열려 있습니다. 💰 Wealth에서 Page of Cups는 창의성과 신중함을 바탕으로 재정에 접근할 것을 조언합니다. 여기에는 예술적 또는 직관적 재능을 통해 새로운 수입원을 탐색하고, 자신이 가진 것에 대해 감사하는 마음을 실천하고, 물질적 이득에만 집중하기보다는 감정적 웰빙을 풍요롭게 하는 경험에 투자하는 것이 포함될 수 있습니다. 번영은 기쁨과 성취를 지원할 때 가장 의미가 있다는 점을 상기시켜 줍니다. ✨ 궁극적으로 Page of Cups는 개방성과 창의성을 포용함으로써 이를 확인하는 부드러운 격려와 정서적 재생의 카드입니다.\n그리고 진정성, 사랑, 직업을 넘나들며 의미 있는 성장을 펼칠 수 있습니다.\n그리고 금융생활. 🙂 아주 작은 시작이라도 심오한 성취로 꽃피울 수 있다는 것을 알고, 조용한 영감의 감동을 믿으세요.",
      "Llama": "Page of Cups는 호기심, 직관의 원형을 표현한 것입니다.\n그리고 감정적 각성은 프랑스 신비주의자들이 만들고 나중에 Arthur Edward Waite의 Rider-Waite-Smith(RWS) 덱으로 대중화된 15세기 우화 카드로 거슬러 올라가는 기원을 가진 다양한 타로 덱에서 발견됩니다. 이 카드는 수용성, 민감성의 에너지를 구현합니다.\n그리고 감성 지능.\n\n The Page of Cups는 물가에 서 있는 젊은 인물을 묘사하며, 종종 감정을 반영하면서 새로운 깊이를 탐험하라는 요청을 받는 것과 관련이 있습니다.\n그리고 지침에 대한 직관을 신뢰하십시오.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n 이 카드는 관계를 탐색할 때 감정적 직관에 귀를 기울일 것을 조언합니다. 당신의 감정에 주의를 기울이고 내면의 나침반이 당신을 건강한 연결과 파트너십으로 인도할 것이라고 믿으십시오.\n\n💼 경력: 전문적 숙달의 정점\n Page of Cups는 새로운 아이디어를 받아들이고 열린 마음을 가질 것을 제안합니다.\n그리고 직장에서 직관에 따라 자신을 인도하십시오. 귀하의 가치에 부합하는 가능성과 기회를 탐색하십시오.\n\n💰 부: 완전한 재정적 자유와 지속적인 유산\n 이 카드는 진정한 풍요가 종종 호기심과 수용의 장소에서 나온다는 것을 나타냅니다. 열린 마음으로 재정적 결정에 접근하고, 새로운 경험을 받아들일 때 필요한 것을 얻을 수 있을 것이라고 믿으십시오."
