      "DeepSeek": "Ace of Swords는 지적 혁신과 흔들리지 않는 명료함, 즉 혼란을 꿰뚫는 갑작스럽고 꿰뚫는 통찰력이라는 순수한 원형을 구현합니다.\n⚠️ [위험요소]\n 파괴적인 해고:\n💖 사랑: 연민 없이 펼쳐지는 잔혹한 정직함, 드러난 진실의 순수한 힘으로 관계를 끊고, 정서적 보존보다 지적 승리를 우선시합니다.\n💼 경력: 논리적으로는 완벽하지만 체계적인 조화를 방해하고 강력한 적과 고립을 만드는 급진적인 아이디어 또는 법적 전략입니다.\n💰 부: 전체 청산 또는 공격적인 매도 포지션을 강요하는 냉혹한 분석으로, 이론상으로는 정확하지만 시기상으로는 위험할 정도로 시기상조이며, 시장의 비합리성이 지속되면 치명적인 손실로 이어집니다.\n🎁 [잠재적 보상]\n 주권적 분별력:\n💖 사랑: 환상을 없애고 관계가 진정한 조건에 기초하거나 정당하게 종료되도록 하는 날카로운 명확성입니다.\n💼 경력: 새로운 패러다임을 정의하는 기본 개념 또는 법적 판례로, 논쟁의 여지가 없는 권한을 부여합니다.\n💰 부: 시장 결함이나 저평가된 자산을 명확하게 식별하는 것은 높은 확신과 높은 수익의 초석이 됩니다.\n양날의 기원으로서의 진실입니다.",
      "Perplexity": "Ace of Swords는 마르세유 Rider-Waite-Smith의 첫 번째 에어 핍입니다.\n그리고 토트 마이너 아르카나 전통은 정신적 돌파구, 예리한 진실을 구현합니다.\n그리고 정령 지성의 왕관을 쓴 칼날이 환상을 꿰뚫어 수정 같은 선명함을 선사합니다.\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n\n사랑에 빠진 에이스 오브 소드(Ace of Swords)는 급진적인 솔직함으로 속임수를 꿰뚫습니다. 진실한 대화는 오해를 해결하거나 결정적인 조치를 요구하는 비호환성을 드러냅니다.\n싱글들은 장밋빛 환상에서 벗어나 진정한 관계를 주장하기 위해 분별력을 발휘합니다.\n부부는 용기 있는 취약성을 통해 깨지지 않는 신뢰를 형성합니다.\n영적으로, 그것은 정신적 명료함이 영혼을 기리는 결합을 탄생시키는 사랑의 정화 칼날을 확증합니다.\n\n💼 경력: 전문적 숙달의 정점\n\n성공을 위해 Ace of Swords는 지적 승리를 예고합니다. 법적 승리, 혁신적인 전략 또는 커뮤니케이션 혁신은 글쓰기, 옹호 또는 기술 벤처 분야에서 권위 있는 리더십을 확립합니다.\n왕관은 날카로운 집중력을 통해 번영을 약속합니다.\n새로운 아이디어가 시장을 결정적으로 정복합니다.\n타로 전설은 산 꼭대기 칼날을 진실한 전략을 통해 지배력을 나타내는 정신적 주권으로 장식합니다.\n\n🧠 사고방식: 내면의 지혜와 성장\n\nAce of Swords는 지적인 두려움을 키우고 진실의 양날의 선물을 파악하는 동시에 무자비한 명확성과 자비로운 전달의 균형을 유지합니다.\n획기적인 사고방식을 받아들이고 망상을 잘라 더 높은 의식을 해방시키세요.\n순수한 생각은 현실을 만들어낸다.\n이 원형은 마음의 홀이 우주적 정의를 휘두르는 영적 차별을 일깨웁니다.",
      "Copilot": "Ace of Swords는 명확성과 진실의 에너지를 구현합니다.\n그리고 지적 돌파구는 정신적 각성, 결단력 있는 행동의 카드입니다.\n그리고 환상을 깨고 현실을 드러내는 힘. 그 본질은 날카로운 집중력과 정직함을 말합니다.\n그리고 이성과 진실성을 가지고 도전에 맞서는 용기는 우리가 생각을 진실과 일치시킬 때 지혜가 탄생한다는 것을 상기시켜 줍니다. 💖 사랑에서 Ace of Swords는 명확한 의사소통과 정직의 필요성을 제안합니다. 싱글이라면 자신의 의도를 공개적으로 표현하고 잠재적인 파트너가 자신의 가치관과 일치하는지 식별하는 것이 중요하다는 점을 나타냅니다.\n관계에서 이는 오해를 직접 해결하고 진실을 바탕으로 토대를 마련해야 할 필요성을 강조합니다. 실용적인 단계에는 솔직한 대화 시작, 존중을 바탕으로 경계 설정 등이 포함됩니다.\n그리고 명확성을 사용하여 신뢰를 강화합니다. 💼 경력에서 이 카드는 획기적인 발전, 새로운 아이디어를 나타냅니다.\n그리고 결단력 있는 리더십; 그것은 당신의 직업적 진로를 바꾸는 갑작스러운 통찰력을 얻는 것을 의미할 수도 있고, 진정으로 중요한 것에 집중하기 위해 주의를 산만하게 하는 것을 없애거나 권위를 확립하는 혁신적인 솔루션을 제시하는 것을 의미할 수도 있습니다. 실행 가능한 조언에는 자신감을 가지고 말할 수 있는 기회를 받아들이고 지적 엄격함을 요구하는 프로젝트를 추구하는 것이 포함됩니다.\n그리고 논리를 사용하여 복잡한 과제를 탐색합니다. 💰 Wealth에서 Ace of Swords는 정확하고 전략적인 재정 접근을 조언합니다. 여기에는 비판적인 시각으로 투자를 재평가하고, 대담하지만 잘 조사된 결정을 내리거나, 불필요한 비용을 제거하여 간소화된 성장 계획을 세우는 것이 포함될 수 있습니다. 실용적인 단계에는 재무 데이터를 신중하게 분석하고, 필요할 때 전문가의 조언을 구하는 것이 포함됩니다.\n그리고 충동보다는 명확성에 따라 선택이 이루어지도록 보장합니다. ✨ 궁극적으로 Ace of Swords는 진실을 통해 권한을 부여하고 명확성과 정직성을 포용함으로써 이를 확인하는 카드입니다.\n그리고 결단력 있는 생각, 사랑, 직업을 넘나드는 성취감을 기를 수 있습니다.\n그리고 금융생활. 🙂 명확한 비전이 지속적인 성공과 의미 있는 발전을 향해 안내할 것이라는 사실을 알고 혼란을 극복하고 정직하게 행동하는 능력을 믿으십시오.",
      "Llama": "Ace of Swords는 정신적 명확성과 통찰력의 원형을 표현합니다.\n그리고 프랑스 신비주의자들이 만들고 나중에 Arthur Edward Waite의 Rider-Waite-Smith(RWS) 덱으로 대중화된 15세기 우화 카드로 거슬러 올라가는 다양한 타로 덱에서 발견된 지적 잠재력. 이 카드는 집중력, 분석적 사고의 에너지를 구현합니다.\n그리고 명확한 의사결정을 하세요.\n\n Ace of Swords는 직립형 검을 들고 있는 인물을 묘사하며, 종종 정신적 명료함, 지적 호기심과 관련이 있습니다.\n그리고 새로운 통찰력. 그것은 정신적 예민함의 불꽃과 지적 성장의 잠재력을 나타냅니다.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n 이 카드는 정신적 명확성과 열린 마음으로 사랑 관계에 접근하고, 정직하고 논리적인 토론을 기꺼이 할 것을 조언합니다.\n그리고 합리적 사고로 당신의 연결을 평가하십시오. 감정보다는 사실에 기반한 의사소통을 우선시합니다.\n\n💼 경력: 전문적 숙달의 정점\n Ace of Swords는 직업적 성공이 지적 능력을 개발하고 상황을 비판적으로 분석하는 데서 비롯된다고 제안합니다.\n그리고 명확한 사고를 통해 정보에 입각한 결정을 내립니다. 논리와 객관적 분석을 사용하여 전문적인 과제를 탐색하고 혁신적인 솔루션을 찾습니다.\n\n💰 부: 완전한 재정적 자유와 지속적인 유산\n 이 카드는 연구와 데이터를 기반으로 한 현명하고 분별력 있는 선택을 통해 진정한 번영이 이루어진다는 것을 나타냅니다.\n그리고 정신적 명확성. 지식과 교육을 우선시하십시오.\n그리고 정보에 입각한 재정적 결정을 내리기 위한 정신적 훈련이 필요합니다."
