      "DeepSeek": "The Three of Swords는 고통스럽고 피할 수 없는 진실, 즉 결정적인 선택이나 계시에 따른 배신, 상실, 깊은 실망의 날카로운 슬픔과의 심리적 대결을 구현합니다.\n내재된 위험은 낭만적인 고통입니다.\n💖 사랑: 비탄이 치유를 불가능하게 하고 미래의 취약성을 냉소주의로 오염시키는 친숙한 안식처가 되는 정체성으로서의 슬픔의 배양.\n💼 경력: 직업적 실패나 배신을 영구적이고 결정적인 상처로 내면화하고 적응을 방해하며 새로운 동맹을 거부하는 피해자 정신을 육성합니다.\n💰 부: 위험은 미래의 모든 위험 평가를 왜곡하여 마비된 두려움이나 손실을 되찾으려는 무모한 시도로 이어지는 특정 금전적 손실(예: 악성 부채, 투자 실패)에 대한 감정적 집착입니다.\n🎁 [잠재적 보상]\n 슬픔의 카타르시스적 명확성:\n💖 사랑: 고통스럽지만 필요한 환상의 절제, 미래의 보다 진정한 연결에 필요한 원시적이고 깨끗한 공간을 만듭니다.\n💼 경력: 더욱 탄력 있고 안목 있는 전문가를 양성하는 신뢰, 경쟁 또는 시장 현실에 관해 힘들게 얻은 지혜입니다.\n💰 부: 손실에 대한 명확한 인식, 적절한 회계 처리, 세금 징수 가능.\n그리고 짐 없이 자본을 재분배할 수 있는 정서적 해방입니다.\n여기서 고통은 가혹하지만 정확한 스승이다.",
      "Perplexity": "Three of Swords, 마르세유 Rider-Waite-Smith의 세 번째 에어 핍.\n그리고 토트 마이너 아르카나(Thoth Minor Arcana) 전통은 날카로운 비통함과 정신적 고통을 구현합니다.\n그리고 토성의 삼지창 진실은 환상을 꿰뚫고 필요한 정서적 정화를 촉진합니다.\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n\n사랑에 빠진 Three of Swords는 파괴적인 배신을 드러냅니다. 불신앙, 버림, 잔혹한 정직은 마음을 찢고 폭풍 구름 아래에 원시적인 취약성을 노출시킵니다.\n싱글의 얼굴 거부의 선명한 선명도, 진정한 유대감을 위한 공간을 비워줍니다.\n커플은 독성 패턴을 제거하는 데 필요한 파열을 견뎌냅니다.\n영적으로, 그 진홍빛 상처는 슬픔의 연금술적 은총을 확증하며, 여기서 깨어짐은 더 깊은 관계적 지혜를 낳습니다.\n💼 경력: 전문적 숙달의 정점\n\n성공을 위해 Three of Swords는 전문적인 슬픔을 나타냅니다. 해고, 파트너십 중단 또는 협상 실패는 전략적 회복에 앞서 잃어버린 야망에 대한 슬픔을 요구합니다.\n법적 패배나 대중의 비판은 미래의 분별력을 날카롭게 합니다.\n고통은 회복력 있는 리더십을 만들어낸다.\n타로 전통은 폭풍에 휩싸인 심장을 도가니의 정화로 묘사하며, 여기서 지속 가능한 번영을 위해 정신적 명확성이 더욱 강해집니다.\n🧠 사고방식: 내면의 지혜와 성장\n\nThree of Swords는 용기 있는 슬픔을 키우고 비통함을 정화하는 칼날을 기리며 진실의 절개에 따른 치유를 믿습니다.\n정직한 계산을 통해 거부를 해제하십시오.\n상처는 더 높은 의식을 이끄는 성스러운 낙인이 됩니다.\n이 원형은 영적 차별을 일깨워 정신적 고통을 자비로운 주권으로 전환시킵니다.",
      "Copilot": "Three of Swords는 비탄과 고통스러운 진실의 에너지를 구현합니다.\n그리고 감정의 해방은 슬픔, 이별의 카드입니다.\n그리고 환상이 깨질 때 찾아오는 날카로운 명료함은 고통은 피할 수 없지만 치유와 변화의 길을 열어준다는 사실을 상기시켜 줍니다. 그 본질은 정직과 수용을 말합니다.\n그리고 상처를 억누르기보다 직접적으로 마주하는 용기. 💖 사랑에서 세 개의 검은 종종 비통함, 배신 또는 감정적 거리를 나타냅니다. 싱글이라면 새로운 사랑이 시작되기 전에 인정해야 할 과거 관계의 지속적인 슬픔을 반영할 수 있습니다.\nIn partnerships it highlights the need to face painful truths, whether through difficult conversations, forgiveness, or the recognition that some connections may no longer serve your growth—practical steps include journaling emotions, seeking closure.\n그리고 자신과 다른 사람에 대한 신뢰를 회복하면서 자기 연민을 실천하십시오. 💼 경력에서 이 카드는 실망, 갈등 또는 좌절을 나타냅니다. 이는 거절에 직면하거나, 직장 내 긴장을 견디거나, 전문적인 경로가 자신의 가치와 일치하지 않는다는 사실을 깨닫는 것을 의미할 수 있습니다. 실행 가능한 조언에는 실패를 교훈으로 재구성하고, 정직과 외교를 통해 갈등을 해결하는 것이 포함됩니다.\n그리고 도전 과제를 촉매제로 사용하여 더 만족스러운 기회로 에너지를 전환합니다. 💰 부에서 Three of Swords는 재정적 손실, 후회 또는 자원 부족을 경고합니다. 여기에는 예상치 못한 비용, 부진한 투자 또는 재정적 불안정으로 인한 정서적 스트레스가 포함될 수 있습니다. 실제 단계에는 재무 전략 재평가, 전문적인 조언 구가 포함됩니다.\n그리고 과거의 실수에 연연하기보다는 인내와 규율을 통해 안정을 재건하는 데 집중합니다. ✨ 궁극적으로 Three of Swords는 회복력과 재생의 카드로, 고통이 압도적으로 느껴지지만 성장의 길을 여는 교사이기도 함을 확인합니다. 용기를 가지고 비탄에 맞서고 슬픔을 지혜로 전환함으로써 치유와 명쾌함을 위한 공간을 만들 수 있습니다.\n그리고 사랑, 직업의 궁극적인 성취.\n그리고 금융생활.",
      "Llama": "Three of Swords는 정신적 혼란, 정서적 혼란의 원형을 표현한 것입니다.\n그리고 프랑스 신비주의자들이 만들고 나중에 Arthur Edward Waite의 Rider-Waite-Smith(RWS) 덱으로 대중화되었던 15세기 우화 카드로 거슬러 올라가는 다양한 타로 덱에서 지적 단편화가 발견되었습니다. 이 카드는 고통스러운 우유부단함과 자기 의심의 에너지를 구현합니다.\n그리고 내면의 갈등.\n\n The Three of Swords depicts a figure seated between two crossed swords with another sword piercing their head, often associated with mental turmoil, emotional pain, or conflicted thoughts. 이는 상충되는 관점에 압도되어 결정을 내릴 수 없음을 나타냅니다.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n 이 카드는 관계에서 너무 많은 감정적 부담을 지거나 다른 사람의 의견에 지나치게 민감한 것을 경고합니다.\n그리고 내면의 갈등에 휘말리게 됩니다. 경계를 설정하고 파트너와 공개적으로 소통하는 방법을 배우십시오.\n\n💼 경력: 전문적 숙달의 정점\n Three of Swords는 직업적 어려움이 종종 우유부단함, 집중력 부족 또는 우선순위 상충에서 비롯된다는 점을 시사합니다. 명확한 목표의 우선순위를 정하고 업무를 효과적으로 위임하세요.\n그리고 너무 얇게 펴지 마십시오.\n\n💰 부: 완전한 재정적 자유와 지속적인 유산\n 이 카드는 잘못된 의사 결정, 과도한 지출 또는 내부 혼란으로 인한 재정 관리 실패로 인해 재정적 어려움이 발생할 수 있음을 나타냅니다. 예산 편성을 실천하고 장기적인 재정 안정성을 우선시합니다."
