      "Llama": "검의 페이지(Page of Swords)는 지적 호기심, 정신적 탐구의 원형을 표현한 것입니다.\n그리고 의사소통 인식은 프랑스 신비주의자들이 만들고 나중에 Arthur Edward Waite의 Rider-Waite-Smith(RWS) 덱으로 대중화된 15세기 우화 카드로 거슬러 올라가는 다양한 타로 덱에서 발견됩니다. 이 카드는 탐구, 조사의 에너지를 구현합니다.\n그리고 정신적 민첩성.\n\n Page of Swords는 종종 지적 호기심, 빠른 사고와 관련된 칼을 들고 있는 젊은 인물을 묘사합니다.\n그리고 분석적인 통찰력. 그것은 아이디어의 불꽃, 정신적 민첩성을 나타냅니다.\n그리고 혁신적인 문제 해결.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n 이 카드는 관계 갈등을 해결하기 위해 조언이나 정보를 구하는 것이 개인 성장에 도움이 될 수 있음을 시사합니다. 솔직한 자기 성찰을 하고, 파트너와 함께 자신의 생각과 감정을 탐구해보세요.\n그리고 대안적인 관점을 고려해보세요.\n\n💼 경력: 전문적 숙달의 정점\n 검의 페이지는 지식을 추구하고 실수로부터 배우는 것을 나타냅니다.\n그리고 새로운 아이디어를 탐구하는 것이 직업적 성공의 열쇠입니다. 지속적인 교육을 우선시하고 자신의 분야에 대한 호기심을 유지하십시오.\n그리고 혁신적인 접근 방식에 열려 있어야 합니다.\n\n💰 부: 완전한 재정적 자유와 지속적인 유산\n 이 카드는 투자 결정을 내리기 전에 위험의 재정적 영향을 고려하도록 조언합니다. 대안적인 재무 전략을 탐색하고 잠재적 결과를 고려하십시오.\n그리고 정보에 입각한 주의를 기울여 위험의 균형을 맞추세요."
