      "Gemini": "Knight of Swords: 꿈을 향해 돌진하다!\n\n          검의 기사는 순수하고 멈출 수 없는 에너지의 폭발과도 같습니다! 강력한 말을 타고 빛나는 검을 높이 들고 앞으로 돌진하며 바람의 속도로 어떤 어려움도 극복할 준비가 되어 있는 용감한 기사를 상상해 보십시오.\n이 카드는 당신이 급속한 발전과 완전한 결단력의 시기에 진입하고 있다는 빛나고 희망적인 신호입니다.\n그것은 당신이 기다리기를 멈추고 \"실행\"을 시작하기로 결정한 순간을 나타냅니다. 당신은 목표를 최고 속도로 추구할 수 있는 정신적 명확성과 용기를 가지고 있습니다.\n그리고 우주는 당신에게 강력한 순풍을 불어넣고 있습니다! 지금은 대담하고 결단력이 있어야 할 때입니다.\n그리고 맹렬하게 집중했습니다.\n당신의 날카로운 재치와 끊임없는 추진력으로 당신을 가로막는 모든 장애물이 곧 제거될 것입니다.\n당신의 인생은 매우 흥미롭고 빠른 속도로 앞으로 나아갈 것이기 때문에 준비하십시오!\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n 사랑: 대담한 선언과 빠른 속도의 로맨스\n\n          사랑에 빠진 검의 기사는 '움직이는' 희망적인 에너지를 선사합니다! 당신이 싱글이라면, 이 카드는 지적으로 자극적이고 직접적인 사람과의 갑작스럽고 흥미로운 만남을 제안합니다. 또는 아마도 당신은 마침내 당신의 감정을 정확히 말할 수 있을 만큼 대담한 사람일 것입니다! 관계에 있는 사람들에게는 상쾌한 속도와 정직함으로 \"공기를 맑게 하는\" 시간입니다.\n귀하와 귀하의 파트너는 오랜 망설임을 극복하고 미래를 위한 빠르고 흥미로운 계획을 세우고 있습니다.\n즉흥적인 여행이든, 몇 분 만에 문제를 해결하는 깊고 솔직한 대화이든, 직접적인 행동과 지적 불꽃을 통해 유대감이 커집니다.\n당신의 사랑 생활은 놀라운 추진력을 얻고 있습니다.\n열정과 완벽한 투명성으로 가득 찬 스릴 넘치는 라이딩입니다!\n\n💼 경력: 전문적 숙달의 정점\n 경력: 빠른 속도의 성공과 탁월한 집중력\n\n          전문적으로 Knight of Swords는 \"목표를 분쇄\"하고 빠른 돌파구를 달성하는 환상적인 징조입니다! 당신은 놀라운 효율성과 날카로운 집중력으로 일할 수 있는 단계에 있습니다.\n이 카드는 당신이 스스로 생각하고 권위와 소통하는 능력이 당신을 직장에서 스타로 만든다는 것을 암시합니다.\n대규모 프로젝트를 시작하거나, 대담한 아이디어를 제시하거나, 빠른 의사결정이 필요한 어려운 작업을 주도하기에 완벽한 시기입니다.\n당신은 도전을 두려워하지 않고 결과를 얻는 방법을 정확히 아는 높은 성취자로 간주됩니다.\n당신이 경력 \"점프\"를 기다리고 있었다면, 이것이다! 당신에게는 결단력이 있고 그것을 뒷받침할 재능이 있기 때문에 당신의 직업 생활은 폭발적으로 증가하고 있습니다!\n\n💰 부: 완전한 재정적 자유와 지속적인 유산\n 부: 빠른 승리와 결정적인 재정적 움직임\n\n          부와 관련하여 검의 기사는 \"현명하고 빠르게 움직이는 번영\"의 시기를 알리고 당신의 재정적 운명을 책임질 것입니다! 그것은 당신이 어떤 망설임도 극복하고 빠르게 성과를 거둘 수 있는 요령 있는 행동을 하고 있다는 희망적인 신호입니다.\n이 카드는 당신이 적극적으로 행동하도록 격려합니다. 영리한 투자나 소득을 늘릴 수 있는 방법이 보이면 자신감을 갖고 계속 진행하세요! 빠르게 진행되는 금융 뉴스를 접하거나 완벽하게 작동하는 저축 목표에 대한 \"지름길\"을 찾을 수도 있습니다.\n경계심을 유지하고 자원에 대한 결단력을 갖추면 미래를 보호하고 높은 에너지에 맞는 풍요의 흐름을 만들 수 있습니다.\n당신은 빠른 생각으로 곧바로 더 안전하고 번영하는 은행 계좌를 확보할 수 있는 \"금융 모멘텀\"의 달인이 되어가고 있습니다!",
      "DeepSeek": "Knight of Swords는 전격전 전술로서 날카로운 논리와 공격적인 의사소통을 적용하는 무자비한 지적 속도의 심리적 원형을 구현합니다.\n본질적인 위험은 파괴적인 충동성입니다.\n💖 사랑: 파트너의 감정을 제거하는 언어적 공격과 무자비한 \"진실\" 추구, 감정적 연결을 희생하여 논쟁에서 승리하고 원한의 전쟁터를 만듭니다.\n💼 경력: 위험은 지성의 힘과 대결 스타일에 의존하여 장애물을 압도하고, 종종 관계에 부수적인 피해를 입히고 지속 불가능하고 단편적인 승리를 초래하는, 불완전한 계획으로 복잡한 상황으로 돌진하는 것입니다.\n💰 부: 설득력 있지만 잠재적으로 결함이 있는 이론을 기반으로 한 고속, 높은 확신의 거래를 나타내며, 적절한 위험 완화 없이 급격한 움직임에 상당한 자본을 위험에 빠뜨리고 갑작스러운 반전에 취약합니다.\n🎁 [잠재적 보상]\n 단호하고 패러다임을 뒤흔드는 행동:\n💖 사랑: 관계의 교착 상태를 깨는 고통스러운 진실을 표현하기 위해 잔인하지만 필요한 용기.\n💼 경력: 관료적 관성과 지적 가식을 극복하고 다른 사람들이 고려하는 곳에서 신속하고 결정적인 결과를 달성하는 능력.\n💰 부: 짧은 재정 거래 창이나 단기 추세를 활용하여 진정한 시장 통찰력에 대해 신속하고 확신 있게 행동할 수 있는 능력입니다.\n가드가 부족한 무기로서의 지성입니다.",
      "Perplexity": "Knight of Swords , 마르세유 라이더-웨이트-스미스에 있는 에어슈트의 두 번째 코트 카드입니다.\n그리고 토트 마이너 아르카나 전통은 충전되는 지성과 무자비한 진실을 구현합니다.\n그리고 바람의 추진력이 굴하지 않는 정신력으로 환영을 가르는 폭풍 같은 액션.\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n\n사랑에 빠진 Knight of Swords는 낭만적인 전장을 돌진합니다. 무뚝뚝한 선언은 환상을 깨뜨리고, 회오리바람 같은 구혼은 두려움 없는 정직함으로 불붙지만, 무모한 말은 배려 없이 깊은 상처를 입힙니다.\n싱글은 정신적 항복을 요구하는 역동적인 도전자를 끌어들입니다.\n부부는 침체를 해소하는 폭발적인 대결에 직면합니다.\n영적으로, 그 충전된 선명함은 진실의 칼날이 감성을 넘어 깨지지 않는 유대를 형성하는 사랑의 정화의 돌풍을 드러냅니다.\n💼 경력: 전문적 숙달의 정점\n\n성공을 위해 Knight of Swords는 공격적인 옹호를 통한 법적 승리, 엄청난 속도로 시작된 기술 혁신, 정밀하게 실행된 기업 인수 등 빠른 돌파구를 제공합니다.\n성급한 돌진은 전투에서 승리하지만 끔찍한 승리를 가져올 위험이 있습니다.\n무자비한 진격 전에 동맹국은 흩어집니다.\n타로 전통은 폭풍에 의한 공격을 승리의 정복으로 묘사하며, 결단력 있는 지성이 망설임에 대한 지배력을 확보합니다.\n🧠 사고방식: 내면의 지혜와 성장\n\nKnight of Swords는 전략적 호흡을 통해 충동을 제어하는 동시에 정신의 번개를 활용하여 의도적인 타격을 가하는 방향성 있는 흉포함을 기릅니다.\n진실은 행동을 요구하지만 지혜는 속도를 조절합니다.\n이 원형은 전사의 분별력을 일깨워 무모한 지성을 깨달은 주권으로 변화시킵니다.",
