      "Llama": "Knight of Swords는 지적 행동, 정신적 결단력의 원형을 나타냅니다.\n그리고 프랑스 신비주의자들이 만들고 나중에 Arthur Edward Waite의 Rider-Waite-Smith(RWS) 덱으로 대중화된 15세기 우화 카드로 거슬러 올라가는 다양한 타로 덱에서 발견되는 단호한 의사소통. 이 카드는 신속한 의사결정, 예리한 사고의 에너지를 구현합니다.\n그리고 직접적인 표현.\n\n Knight of Swords는 백마를 탄 기사를 묘사하며 종종 정신적 명료함, 지적 용기와 관련이 있습니다.\n그리고 결단력 있는 행동. 이는 합리적인 사고와 정신적 민첩성을 통해 문제와 갈등을 해결하기 위한 과감한 조치를 취하는 것을 나타냅니다.\n\n💖 사랑: 믿음직한 헌신과 황금빛 미래\n 이 카드는 파트너에게 자신의 감정과 요구 사항을 직접적이고 단호하게 표현하도록 조언합니다. 명확한 의사소통을 우선시하고 \"나\" 진술을 사용하십시오.\n그리고 적극적으로 경청하세요.\n\n💼 경력: 전문적 숙달의 정점\n Knight of Swords는 빠른 사고를 통해 계산된 위험을 감수하는 것을 나타냅니다.\n그리고 직업적 성공을 달성하기 위한 결단력 있는 행동. 논리적 의사결정, 전략적 계획에 중점을 둡니다.\n그리고 결정적인 실행.\n\n💰 부: 완전한 재정적 자유와 지속적인 유산\n 이 카드는 모든 옵션을 신중하게 고려하여 투자 또는 재정적 선택에 대해 정보를 바탕으로 신속한 결정을 내릴 것을 제안합니다. 장점과 단점을 따져보고 명확한 목표를 설정하세요.\n그리고 계산된 결단력을 가지고 행동하십시오."
